When Component.ADM_APPL_ENTRY1
When Component.ADM_PROSPECT_PROG
When Component.SCC_BIO_DEMO
When Component.QUICK_ADMIT
When Component.ADM_APPL_MAINTNCE
When Component.SSR_HE_PRG_ENQ_NLD
When Component.SCC_CONST_STG
When Component.SCC_CONST_STG
When Component.SAD_APPL_STG
   Break;
When Component.SS_CC_ADDRESSES
When Component.SS_CC_NAMES
   DERIVED_PERDATA.NAME = get_person_name(LS_SS_PERS_SRCH.EMPLID, "", "", "");
   Break;
When Component.SS_CC_TODOS
When Component.CC_CHKLST_TODOS
When Component.SSS_PRSNLDATA_SUMM
   DERIVED_PERDATA.NAME = get_person_name(SRVCIND_TODO_VW.RESPONSIBLE_ID, "", "", "");
   Break;

   /*<* jbg 11-05-2013 Bundle 31 fix for PT 8.52 (uncomment when we upgrade to PT 8.53 *>  GJ 3/14/2016 */
When Component.SSS_STUDENT_CENTER
   Local Field &res_id;
   &res_id = GetLevel0()(1).GetRowset(Scroll.SRVCIND_TODO_VW).GetRow(CurrentRowNumber()).GetRecord(Record.SRVCIND_TODO_VW).GetField(Field.RESPONSIBLE_ID);
   DERIVED_PERDATA.NAME = get_person_name(&res_id.Value, "", "", "");
   Break;
   /*<*jbg 11-05-2013 Bundle 31 fix for PT 8.52 (uncomment when we upgrade to PT 8.53 *>  rem GJ 3/14/2016 */

When Component.SFA_SAP_STDNT
   DERIVED_PERDATA.NAME = get_person_name(SFA_SAP_FATRM_V.EMPLID, "", "", "");
   Break;
When Component.SFA_SAP_STDNT_SIM
   DERIVED_PERDATA.NAME = get_person_name(SFA_SAP_RPTHSVW.EMPLID, "", "", "");
   Break;

When Component.SSS_GRAD_STATUS
   DERIVED_PERDATA.NAME = get_person_name(SS_PERS_GRAD_VW.EMPLID, "", "", "");
   Break;
When-Other
   DERIVED_PERDATA.NAME = get_person_name(SCC_PERS_SA_VW.EMPLID, "", "", "");
   Break;
End-Evaluate;

import SCC_MANAGE_SI_SECURITY:SCC_DISPLAY:SrvcIndScrty;
import PTAI_ACTION_ITEMS:Privilege;

Local SCC_MANAGE_SI_SECURITY:SCC_DISPLAY:SrvcIndScrty &obj_si_scrty;
Local Rowset &rsPerson;

Local Field &SORTBY;
Local Rowset &level0rowset, &level1rowset, &RS_DATA, &level1rowset_task;
Local Row &RS;
Local number &DCSDSICNT;
Local Record &VAR_DATA_REC, &DERIVED_REC;
Local SQL &SQL;
Local boolean &bolNegDisplay, &bolPosDisplay;
Local integer &intCountNeg, &intCountPos;

Function SI_SecurityNeg(&EMPLID)

   &bolNegDisplay = False;
   &intCountNeg = 0;

   &rsPerson = CreateRowset(Record.SRVC_IND_DATA);
   &rsPerson.Fill(" WHERE EMPLID = :1 AND POS_SRVC_INDICATOR= 'N' ", &EMPLID);
   &obj_si_scrty = create SCC_MANAGE_SI_SECURITY:SCC_DISPLAY:SrvcIndScrty();
   For &i = 1 To &rsPerson.ActiveRowCount
      &str_mode = &obj_si_scrty.getScrty(&rsPerson.GetRow(&i).SRVC_IND_DATA.INSTITUTION.Value, &rsPerson.GetRow(&i).SRVC_IND_DATA.SRVC_IND_CD.Value, &rsPerson.GetRow(&i).SRVC_IND_DATA.SRVC_IND_REASON.Value);
      If &str_mode = "NONE" Then
         &intCountNeg = &intCountNeg + 1;
      End-If;
   End-For;
   If &intCountNeg = &rsPerson.ActiveRowCount Then
      &bolNegDisplay = True;
   End-If;
End-Function;


Function SI_SecurityPos(&EMPLID)
   &bolPosDisplay = False;
   &intCountPos = 0;

   &rsPerson = CreateRowset(Record.SRVC_IND_DATA);
   &rsPerson.Fill(" WHERE EMPLID = :1 AND POS_SRVC_INDICATOR= 'Y' ", &EMPLID);
   &obj_si_scrty = create SCC_MANAGE_SI_SECURITY:SCC_DISPLAY:SrvcIndScrty();
   For &i = 1 To &rsPerson.ActiveRowCount
      &str_mode = &obj_si_scrty.getScrty(&rsPerson.GetRow(&i).SRVC_IND_DATA.INSTITUTION.Value, &rsPerson.GetRow(&i).SRVC_IND_DATA.SRVC_IND_CD.Value, &rsPerson.GetRow(&i).SRVC_IND_DATA.SRVC_IND_REASON.Value);
      If &str_mode = "NONE" Then
         &intCountPos = &intCountPos + 1;
      End-If;
   End-For;
   If &intCountPos = &rsPerson.ActiveRowCount Then
      &bolPosDisplay = True;
   End-If;
End-Function;

Function SI_Check(&EMPLID, &POS_SI_VALUE, &SI_RESULT);
   SQLExec("Select 'X' From PS_SRVC_IND_DATA Where Emplid = :1 And Pos_Srvc_Indicator = :2", &EMPLID, &POS_SI_VALUE, &SI_RESULT);
End-Function;

Function FERPA_SRVC_IND_CHECK(&EMPLID);
   &DCSDSICNT = 0;
   &DATE = %Date;
   &RS_DATA = CreateRowset(Record.SRVC_IND_SEL_VW);
   &RS_DATA.Fill("WHERE EMPLID = :1 And SRVC_IND_CD IN (SELECT A.SRVC_IND_CD FROM PS_SRVC_IND_CD_TBL A WHERE A.SRV_IND_DCSD_FLAG = :2 AND A.EFFDT =(SELECT MAX(A1.EFFDT) FROM PS_SRVC_IND_CD_TBL A1 WHERE A1.INSTITUTION=A.INSTITUTION AND A1.SRVC_IND_CD = A.SRVC_IND_CD AND A1.EFFDT <= %DateIn(:3))AND EFF_STATUS = :4 )", &EMPLID, "Y", %Date, "A");
   &DCSDSICNT = &RS_DATA.ActiveRowCount;

   If &DCSDSICNT = 1 Then
      &SRVC_IND_CD = &RS_DATA(1).SRVC_IND_SEL_VW.SRVC_IND_CD.Value;
      If None(&SRVC_IND_CD) Then
         &DCSDSICNT = 0;
      End-If;
   End-If;
   If All(&EMPLID) Then
      If All(SCC_PERS_SA_VW.DT_OF_DEATH) Or
            &DCSDSICNT >= 1 Then
         /* DECEASED - Show the proper field */
         Hide(DERIVED_CS.FERPA_FLAG);
         Hide(DERIVED_CS.SRVC_IND_NEG);
         Hide(DERIVED_CS.SRVC_IND_POS);
         UnHide(SA_LBL_WRK.DECEASED_LBL);
      Else
         Hide(SA_LBL_WRK.DECEASED_LBL);
         /* FERPA - Check display of button */
         If SCC_PERS_SA_VW.FERPA = "Y" Then
            UnHide(DERIVED_CS.FERPA_FLAG);
         Else
            Hide(DERIVED_CS.FERPA_FLAG);
         End-If;
         /* SI NEG - Check display of button */
         SI_SecurityNeg(&EMPLID);
         SI_Check(&EMPLID, "N", &SI_RESULT);
         If None(&SI_RESULT) Then
            Hide(DERIVED_CS.SRVC_IND_NEG);
         Else
            If &bolNegDisplay Then
               Hide(DERIVED_CS.SRVC_IND_NEG);
            Else
               UnHide(DERIVED_CS.SRVC_IND_NEG);
            End-If;
         End-If;
         /* SI POS - Check display of button */
         SI_SecurityPos(&EMPLID);
         SI_Check(&EMPLID, "Y", &SI_RESULT);
         If None(&SI_RESULT) Then
            Hide(DERIVED_CS.SRVC_IND_POS);
         Else
            If &bolPosDisplay Then
               Hide(DERIVED_CS.SRVC_IND_POS);
            Else
               UnHide(DERIVED_CS.SRVC_IND_POS);
            End-If;
         End-If;
      End-If;
   Else
      /* No ID - Hide all the fields */
      Hide(DERIVED_CS.FERPA_FLAG);
      Hide(DERIVED_CS.SRVC_IND_NEG);
      Hide(DERIVED_CS.SRVC_IND_POS);
      Hide(SA_LBL_WRK.DECEASED_LBL);
   End-If;
End-Function;

Function SS_SRVC_IND_CHECK(&EMPLID);
   If All(&EMPLID) Then
      /* SI NEG - Check display of button */
      SI_Check(&EMPLID, "N", &SI_RESULT);
      If None(&SI_RESULT) Then
         Hide(SS_ACCT_UNIT_VW.SRVC_IND_NEG);
      Else
         UnHide(SS_ACCT_UNIT_VW.SRVC_IND_NEG);
      End-If;
   Else
      /* No ID - Hide Button */
      Hide(SS_ACCT_UNIT_VW.SRVC_IND_NEG);
   End-If;
End-Function;

Function SS_SI_Sort();
   &level0rowset = GetLevel0();
   &RS = GetRow();
   Evaluate %Page
   When "SS_CC_HOLDS"
      &level1rowset = &level0rowset.GetRow(1).GetRowset(Scroll.SRVCIND_BOTH_VW);

   When "SS_CC_TODOS"
      &SORTBY = &RS.DERIVED_CCSRVC2.GetField(Field.SRVC_TODO_SORT_BY);
      &level1rowset = &level0rowset.GetRow(1).GetRowset(Scroll.SRVCIND_TODO_VW);
      Break;
   When-Other
   End-Evaluate;
   Evaluate %Page
   When "SS_CC_HOLDS"
      Evaluate &SORTBY.Value
      When "I"
         &level1rowset.Sort(SRVCIND_BOTH_VW.DESCR, "A");
         Break;
      When "T"
         &level1rowset.Sort(SRVCIND_BOTH_VW.DESCR2, "A");
         Break;
      When "D"
         &level1rowset.Sort(SRVCIND_BOTH_VW.DESCR3, "A");
         Break;
      When-Other
         &level1rowset.Sort(SRVCIND_BOTH_VW.DESCR1.Value, "A", SRVCIND_BOTH_VW.SRVC_IND_ACTIVE_DT.Value, "A");
      End-Evaluate;
   When "SS_CC_TODOS"
      Evaluate &SORTBY.Value
      When "I"
         &level1rowset.Sort(SRVCIND_TODO_VW.DESCR2, "A");
         Break
      When "D"
         &level1rowset.Sort(SRVCIND_TODO_VW.DUE_DT, "A");
         Break;
      When "A"
         &level1rowset.Sort(SRVCIND_TODO_VW.DESCR1, "A");
         Break;
      When-Other
         &level1rowset.Sort(SRVCIND_TODO_VW.DESCR.Value, "A", SRVCIND_TODO_VW.DUE_DT.Value, "A");
         Break;
      End-Evaluate;
   End-Evaluate;
End-Function;

Function SS_SI_SortFilter();
   &level0rowset = GetLevel0();
   &RS = GetRow();

   Evaluate %Page
   When "SS_CC_HOLDS"
      &INST_FILTER = &RS.DERIVED_CCSRVC1.GetField(Field.INSTITUTION).Value;
      &TERM_FILTER = &RS.DERIVED_CCSRVC1.GetField(Field.SRVC_IND_ACT_TERM).Value;
      &DEPT_FILTER = &RS.DERIVED_CCSRVC1.GetField(Field.DEPTID).Value;
      &level1rowset = &level0rowset.GetRow(1).GetRowset(Scroll.SRVCIND_HOLD_VW);
      Break;

   When "SS_CC_TODOS"
      &INST_FILTER = &RS.DERIVED_CCSRVC2.GetField(Field.INSTITUTION).Value;
      &DUED_FILTER = &RS.DERIVED_CCSRVC2.GetField(Field.DUE_DT).Value;
      &ADMF_FILTER = &RS.DERIVED_CCSRVC2.GetField(Field.ADMIN_FUNCTION).Value;
      &level1rowset = &level0rowset.GetRow(1).GetRowset(Scroll.SRVCIND_TODO_VW);
      &level1rowset_task = &level0rowset.GetRow(1).GetRowset(Scroll.SCC_TM_ACTTSKVW);
      Break;
   When-Other
      Break;
   End-Evaluate;

   &WHEREHOLD = "WHERE";

   /*GJ - 3/14/2016*/
   &WHERETASK = " A where A.OPRID =  '" | %OperatorId | "' AND  Exists ( select 'X' from PS_SCC_TM_PTAICNTX cntx where cntx.SCC_TM_LIST_ID =A.SCC_TM_LIST_ID and cntx.SCC_TM_CTX_KEY='Y' and cntx.FIELDNAME ='EMPLID' and cntx.SCC_TM_KEY_VALUE = '" | %EmployeeId | "')";
   /*GJ - 3/14/2016*/
   &FILTER = "N";

   Evaluate %Page
   When "SS_CC_HOLDS"
      If All(&INST_FILTER) Then
         &WHEREHOLD = &WHEREHOLD | " INSTITUTION = '" | &INST_FILTER | "'";
         &FILTER = "Y";
      End-If;
      If All(&TERM_FILTER) Then
         If &FILTER = "Y" Then
            &WHEREHOLD = &WHEREHOLD | " AND";
         End-If;
         &WHEREHOLD = &WHEREHOLD | " SRVC_IND_ACT_TERM = '" | &TERM_FILTER | "'";
         &FILTER = "Y";
      End-If;
      If All(&DEPT_FILTER) Then
         If &FILTER = "Y" Then
            &WHEREHOLD = &WHEREHOLD | " AND";
         End-If;
         &WHEREHOLD = &WHEREHOLD | " DEPTID = '" | &DEPT_FILTER | "'";
         &FILTER = "Y";
      End-If;
      Break;
   When "SS_CC_TODOS"
      /*GJ - 3/14/2016*/
      rem &WHERETASK = " A where A.OPRID =  '" | %OperatorId | "' AND  Exists ( select 'X' from PS_SCC_TM_PTAICNTX cntx where cntx.SCC_TM_LIST_ID =A.SCC_TM_LIST_ID and cntx.SCC_TM_CTX_KEY='Y' and cntx.FIELDNAME ='EMPLID' and cntx.SCC_TM_KEY_VALUE = '" | LS_SS_PERS_SRCH.EMPLID.Value | "')";
      /*GJ - 3/14/2016*/
      If All(&INST_FILTER) Then
         &WHEREHOLD = &WHEREHOLD | " INSTITUTION = '" | &INST_FILTER | "'";
         &WHERETASK = &WHERETASK | " AND  Exists ( select 'X' from PS_SCC_TM_PTAICNTX cntx1 where cntx1.SCC_TM_LIST_ID =A.SCC_TM_LIST_ID and cntx1.SCC_TM_CTX_KEY='Y' and cntx1.FIELDNAME ='INSTITUTION' and cntx1.SCC_TM_KEY_VALUE = '" | &INST_FILTER | "')";

         &FILTER = "Y";
      End-If;
      If All(&ADMF_FILTER) Then
         If &FILTER = "Y" Then
            &WHEREHOLD = &WHEREHOLD | " AND";
         End-If;
         &WHEREHOLD = &WHEREHOLD | " ADMIN_FUNCTION = '" | &ADMF_FILTER | "'";
         &FILTER = "Y";
      End-If;
      If All(&DUED_FILTER) Then
         If &FILTER = "Y" Then
            &WHEREHOLD = &WHEREHOLD | " AND";
         End-If;
         &WHEREHOLD = &WHEREHOLD | " DUE_DT = %DateIn(:1)";
         &WHERETASK = &WHERETASK | " AND A.SCC_TM_DUE_DATE = %DateIn(:1)";
         &FILTER = "Y";
      End-If;
      Break;
   When-Other
   End-Evaluate;

   &level1rowset.Flush();
   /*GJ - 3/14/2016*/
   &level1rowset_task.Flush();
   /*GJ - 3/14/206*/

   Evaluate %Page
   When "SS_CC_HOLDS"
      If &FILTER = "Y" Then
         &level1rowset.Select(Record.SRVCIND_HOLD_VW, &WHEREHOLD | " AND EMPLID = :1", SCC_PERS_SA_VW.EMPLID.Value);
      Else
         &level1rowset.Select(Record.SRVCIND_HOLD_VW, "WHERE EMPLID = :1", SCC_PERS_SA_VW.EMPLID.Value);
      End-If;

      /*Hide the Positive Indicator Codes and the Negative Indicator Codes 
     which in the checkbox Display In Self Service is unchecked*/

      For &i = &level1rowset.ActiveRowCount To 1 Step - 1
         SQLExec("SELECT 'X' FROM PS_SRVC_IND_CD_TBL A WHERE A.INSTITUTION=:1 AND A.SRVC_IND_CD=:2 AND A.EFFDT = ( SELECT MAX( B.EFFDT ) FROM PS_SRVC_IND_CD_TBL B WHERE A.INSTITUTION = B.INSTITUTION AND A.SRVC_IND_CD=B.SRVC_IND_CD AND B.EFFDT<=%DateIn(:3)) AND A.SCC_HOLD_DISPLAY='Y' ", &level1rowset.GetRow(&i).SRVCIND_HOLD_VW.INSTITUTION.Value, &level1rowset.GetRow(&i).SRVCIND_HOLD_VW.SRVC_IND_CD.Value, %Date, &strHld);
         If None(&strHld) Then
            &level1rowset.GetRow(&i).Visible = False;
         End-If;
      End-For;
      Break;

   When "SS_CC_TODOS"
      /*GJ - 3/14/2016*/
      rem &level1rowset_task.Flush();
      /*GJ - 3/14/2016*/
      If &FILTER = "Y" Then

         If (All(&ADMF_FILTER) And
               &ADMF_FILTER <> "GEN") Then

            &VAR_REC_NAME = "Record.VAR_DATA_" | &RS.DERIVED_CCSRVC2.GetField(Field.ADMIN_FUNCTION).Value;
            &VAR_DATA_REC = CreateRecord(@&VAR_REC_NAME);
            &VAR_FLDCNT = &VAR_DATA_REC.FieldCount;
            &COUNT = 0;
            For &i = 3 To &VAR_FLDCNT
               &VAR_FLDNAME = &VAR_DATA_REC.GetField(&i).Name;
               &VAR_FLDLABL = &VAR_DATA_REC.GetField(&i).GetLongLabel(&VAR_FLDNAME);
               &VAR_FLDTYPE = &VAR_DATA_REC.GetField(&i).Type;

               &FLDNUM = &i - 2;

               &DERIVED_RECNAME = "Record.DERIVED_TODO_" | RTrim(String(&FLDNUM));
               &DERIVED_REC = GetLevel0()(1).GetRecord(@&DERIVED_RECNAME);
               &DERIVED_FLDCNT = &DERIVED_REC.FieldCount;

               &MATCH_FLDNUM = 0;

               For &J = 1 To &DERIVED_FLDCNT
                  &FIELDNAME = &DERIVED_REC.GetField(&J).Name;
                  If &FIELDNAME = "DESCR" Or
                        &FIELDNAME = "DESCRSHORT" Or
                        &FIELDNAME = "LONGNAME" Or
                        &FIELDNAME = "FIELDNAME" Or
                        &FIELDNAME = "FIELD_FORMAT" Then
                  Else
                     If &DERIVED_REC.GetField(&J).Type = &VAR_FLDTYPE Then
                        &DERIVED_REC.LONGNAME.Label = &VAR_FLDLABL;
                        &DERIVED_REC.LONGNAME.Value = &VAR_FLDLABL;
                        &DERIVED_REC.FIELDNAME.Value = &VAR_FLDNAME;
                        &DERIVED_REC.FIELD_FORMAT.Value = &VAR_FLDTYPE;
                        &MATCH_FLDNUM = &J;
                     End-If;
                  End-If;
               End-For;

               If All(&DERIVED_REC.GetField(&MATCH_FLDNUM).Value) Then
                  If (&DERIVED_REC.GetField(&MATCH_FLDNUM).Value <> "All") Then
                     &WHERESTRING = &WHERESTRING | " AND " | &VAR_FLDNAME | " = '" | &DERIVED_REC.GetField(&MATCH_FLDNUM).Value | "'  ";
                  End-If;

                  &FETCH_FIELD = "VAR_DATA_SEQ";

                  &SQLString = "SELECT  " | &FETCH_FIELD | "   FROM   PS_VAR_DATA_" | &RS.DERIVED_CCSRVC2.GetField(Field.ADMIN_FUNCTION).Value | " WHERE  COMMON_ID = '" | SCC_PERS_SA_VW.EMPLID | "'" | &WHERESTRING;

                  &SQL = GetSQL(&SQLString);
                  &FETCH_VALUE = "";
                  While &SQL.Fetch(&VAR_DATA_SEQ)
                     &FETCH_VALUE = &VAR_DATA_SEQ | "," | &FETCH_VALUE;
                  End-While;
                  &SQL.Close();
                  &WHERE_COND = " AND " | &FETCH_FIELD | "  IN (" | Substring(&FETCH_VALUE, 1, Len(&FETCH_VALUE) - 1) | ")";

               End-If;
            End-For;
         End-If;


         If All(&DUED_FILTER) Then
            &level1rowset_task.Select(Record.SCC_TM_ACTTSKVW, &WHERETASK, &DUED_FILTER);


            If (&ADMF_FILTER) Then
               If All(&WHERESTRING) Then
                  &level1rowset.Select(Record.SRVCIND_TODO_VW, &WHEREHOLD | &WHERE_COND | " AND EMPLID = :2 ", &DUED_FILTER, LS_SS_PERS_SRCH.EMPLID);
               Else
                  &level1rowset.Select(Record.SRVCIND_TODO_VW, &WHEREHOLD | " AND EMPLID = :2 ", &DUED_FILTER, LS_SS_PERS_SRCH.EMPLID);
               End-If;
            Else
               &level1rowset.Select(Record.SRVCIND_TODO_VW, &WHEREHOLD | " AND EMPLID = :2 ", &DUED_FILTER, LS_SS_PERS_SRCH.EMPLID);
            End-If;
         Else
            &level1rowset_task.Select(Record.SCC_TM_ACTTSKVW, &WHERETASK);
            If (&ADMF_FILTER) Then
               If All(&WHERESTRING) Then
                  &level1rowset.Select(Record.SRVCIND_TODO_VW, &WHEREHOLD | &WHERE_COND | " AND EMPLID = :1 ", LS_SS_PERS_SRCH.EMPLID);
               Else
                  &level1rowset.Select(Record.SRVCIND_TODO_VW, &WHEREHOLD | " AND EMPLID = :1 ", LS_SS_PERS_SRCH.EMPLID);
               End-If;
            End-If;
         End-If;
      Else
         &level1rowset.Select(Record.SRVCIND_TODO_VW, "WHERE EMPLID = :1", LS_SS_PERS_SRCH.EMPLID.Value);
         rem  &level1rowset_task.Select(Record.SCC_TM_ACTTSKVW, " A where A.OPRID = %operatorid AND  Exists ( select 'X' from %table(SCC_TM_PTAICNTX) cntx where cntx.SCC_TM_LIST_ID =A.SCC_TM_LIST_ID and cntx.SCC_TM_CTX_KEY='Y' and cntx.FIELDNAME ='EMPLID' and cntx.SCC_TM_KEY_VALUE = '" | %EmployeeId | "') ");
         &level1rowset_task.Select(Record.SCC_TM_ACTTSKVW, &WHERETASK);

      End-If;
   When-Other
      Break;
   End-Evaluate;

   &Rows = &level1rowset.ActiveRowCount;
   /*GJ - 3/14/2016*/
   &RowsTask = &level1rowset_task.ActiveRowCount;
   /*GJ - 3/14/2016*/
   Local string &HideGrid = "N";
   Local string &HideGridTask = "N";

   Evaluate %Page
   When "SS_CC_HOLDS"
      Break;

   When "SS_CC_TODOS"
      /*GJ - 3/14/2016*/
      rem &RowsTask = &level1rowset_task.ActiveRowCount;
      /*GJ - 3/14/2016*/
      If &Rows < 2 Then
         If None(&level1rowset(1).SRVCIND_TODO_VW.CHKLST_ITEM_CD.Value) Then
            DERIVED_CCSRVC2.SRCH_RESULTS.Value = MsgGetText(14100, 284, "Message Not Found");
            HideScroll(Record.SRVCIND_TODO_VW);
            &HideGrid = "Y";
         End-If;
      End-If;
      If &HideGrid = "N" Then
         UnhideScroll(Record.SRVCIND_TODO_VW);
      End-If;

      If &RowsTask < 2 Then
         If None(&level1rowset_task(1).SCC_TM_ACTTSKVW.SCC_TM_LIST_ID.Value) Then
            HideScroll(Record.SCC_TM_ACTTSKVW);
            &HideGridTask = "Y";
         End-If;
      End-If;
      If &HideGridTask = "N" Then
         UnhideScroll(Record.SCC_TM_ACTTSKVW);
      End-If;

      /* code to populate task details */
      &level1rowset_task.Sort(SCC_TM_ACTTSKVW.SCC_TM_DUE_DATE, "A", SCC_TM_ACTTSKVW.SCC_TM_LABEL, "A");

      For &T = 1 To &level1rowset_task.ActiveRowCount

         &level1rowset_task(&T).SCC_TM_ACTTSKVW.SCC_TM_LABEL.Label = &level1rowset_task(&T).SCC_TM_ACTTSKVW.SCC_TM_LABEL.Value;
         /*  determine if current user has privileges to view items inside the list  */
         &privileges = create PTAI_ACTION_ITEMS:Privilege(&level1rowset_task(&T).SCC_TM_ACTTSKVW.SCC_TM_LIST_ID.Value);
         If Not (&privileges.canViewActionItems) Then
            &level1rowset_task(&T).SCC_TM_ACTTSKVW.SCC_TM_LABEL.Enabled = False;
         End-If;
         rem view SCC_TM_ACTTSKVW only selects "inprogress" records ;
         &level1rowset_task(&T).SCC_TM_ADML_WRK.SCC_TM_LIST_STATUS.Value = "IP";
      End-For;


      Local Rowset &rowsetContext = CreateRowset(Record.SCC_TM_PTAICNTX);

      Local string &richText;
      Local Rowset &level1rowset_task1 = GetLevel0()(1).GetRowset(Scroll.SCC_TM_ACTTSKVW);

      For &i = 1 To &level1rowset_task.ActiveRowCount
         /* Populate the Context field grid */
         &richText = "";
         &rowsetContext.Fill("WHERE SCC_TM_LIST_ID = :1 and SCC_TM_CTX_KEY='Y'  ", &level1rowset_task1(&i).SCC_TM_ACTTSKVW.SCC_TM_LIST_ID.Value);
         For &J = 1 To &rowsetContext.ActiveRowCount
            If All(&rowsetContext(&J).SCC_TM_PTAICNTX.SCC_TM_KEY_LABEL.Value) Or
                  &rowsetContext(&J).SCC_TM_PTAICNTX.SCC_TM_KEY_VALUE.Value Then

               If &rowsetContext(&J).SCC_TM_PTAICNTX.FIELDNAME.Value <> "INSTITUTION" Then
