/***********************************************
Performs following tasks via Ajax request
1. Sets the Current Item flag in ITEM table while clicking an AItem on pagelet

	This function is not called after post processing since we are reloading the
	pagelet after post processing. 
***********************************************/
Function IScript_GetItemStatus

   Local string &strAGItemId, &strAction, &strIsRequired;
   Local PTAI_ACTION_ITEMS:ActionItem &ObjAItem;
   Local PTAI_ACTION_ITEMS:Constants &AIConstants;
   &AIConstants = create PTAI_ACTION_ITEMS:Constants();

   &strAGItemId = Unencode(%Request.GetParameter("PTAI_ITEM_ID"));
   &strAction = Unencode(%Request.GetParameter("PTAI_ACTION"));
   &ObjAItem = create PTAI_ACTION_ITEMS:ActionItem();
   try
      &ObjAItem.open(&strAGItemId);
      Local boolean &bSave;
      Evaluate &strAction
      When = "save"
         /*This is not used since we are reloading the whole pagelet after post processing */
         %Response.Write(EscapeHTML(&ObjAItem.ItemId | "," | &ObjAItem.Status));
         Break;
      When = "click"
         Local string &listId, &actionId;
         &listId = &ObjAItem.ListId;

         SQLExec("update PS_PTAI_ITEM set PTAI_CURR_STEP = 'N' where PTAI_LIST_ID=:1 and PTAI_CURR_STEP='Y'", &listId);

         &ObjAItem.open(&strAGItemId);
         &ObjAItem.CurrentStep = True;
         /* Set the non required item status to In Progress when user visits */
         If ( Not &ObjAItem.Required) Then
            &strIsRequired = "N";
            If &ObjAItem.Status = &AIConstants.STATUS_ASSIGNED Then
               &ObjAItem.Status = &AIConstants.STATUS_IN_PROGRESS;
            End-If;
         Else
            &strIsRequired = "Y";
         End-If;
         &bSave = &ObjAItem.save();
         Break;
      End-Evaluate;
      %Response.Write(EscapeHTML(&ObjAItem.ListId | "," | &ObjAItem.ItemId | "," | &ObjAItem.Status | "," | &strIsRequired));
   catch Exception &e
      %Response.Write(EscapeHTML(&e.ToString()));
   end-try;
End-Function;

