Function IScript_AIPreProcessing
   Local string &strServiceID, &strParameters;
   Local PTAI_ACTION_ITEMS:ActionItem &ObjAItem;
   Local PTCS_SRVDEFN:RCServiceDefinition &srvdefn;

   &strServiceID = Unencode(%Request.GetParameter("SERVICEID"));
