         %Response.Write(EscapeHTML(&ObjAItem.ItemId | "," | &ObjAItem.Status) | ",N," | " ," | &isRequired);
      End-If;

   catch Exception &exp
      %Response.Write(EscapeHTML(&exp.ToString()));
   end-try;
End-Function;



