/***********************************************
Loads AG subpage buttons in WC template
***********************************************/

Function IScript_LoadSubpageButtons
   Local string &list_id, &item_id, &strHtml, &strBind1, &strBind2, &strBind3, &strPrevBtnStyle, &strNextBtnStyle, &strPkg, &strPath, &strClass, &strAppClass, &strHiddenFld, &strMarkCompleteStyle, &strMarkCompleteAnchorStyle;;
   Local number &i;
   Local PTAI_ACTION_ITEMS:List &currentList;
   Local PTAI_ACTION_ITEMS:ActionItem &ObjCurAItem;
   Local PTAI_COLLECTION:Collection &buttons;
   Local PTAI_ACTION_ITEMS:PgltButtons &pgltButtons;
   Local PTAI_ACTION_ITEMS:Constants &AIConstants;

   &list_id = Unencode(%Request.GetParameter("PTAI_LIST_ID"));
   rem &item_id = Unencode(%Request.GetParameter("PTAI_ITEM_ID"));

   &currentList = create PTAI_ACTION_ITEMS:List();
   &AIConstants = create PTAI_ACTION_ITEMS:Constants();

   try
      &currentList.open(&list_id);
      &item_id = &currentList.getCurrentItem();
      &buttons = &currentList.GetPgltBtn();

      &ObjCurAItem = create PTAI_ACTION_ITEMS:ActionItem();
      &ObjCurAItem.open(&item_id);

      For &i = 1 To &buttons.Count
         &pgltButtons = &buttons.Item(&i) As PTAI_ACTION_ITEMS:PgltButtons;
         If &pgltButtons.btnMethod = "MarkComplete" Then
            If &ObjCurAItem.Status = &AIConstants.STATUS_COMPLETED Then
               rem &strMarkCompleteStyle = " class='PSPUSHBUTTONDISABLED' disabled=true ";
               rem &strMarkCompleteAnchorStyle = "class='PSPUSHBUTTONDISABLED' disabled=true ";
               /*gregg - added to hide the button on component pages */
               If &pgltButtons.btnLabel = "_hiddenForComponent" Then
                  &strMarkCompleteStyle = " hidden class='PSPUSHBUTTONDISABLED' disabled=true ";
                  &strMarkCompleteAnchorStyle = " hidden class='PSPUSHBUTTONDISABLED' disabled=true ";
               Else
                  &strMarkCompleteStyle = " class='PSPUSHBUTTONDISABLED' disabled=true ";
                  &strMarkCompleteAnchorStyle = "class='PSPUSHBUTTONDISABLED' disabled=true ";
               End-If;
               /*end gregg */
            Else
               rem &strMarkCompleteStyle = "class='PSPUSHBUTTON'";
               rem &strMarkCompleteAnchorStyle = "class='PSPUSHBUTTON'";
               /*gregg - added to hide the button on component pages */
               If &pgltButtons.btnLabel = "_hiddenForComponent" Then
                  &strMarkCompleteStyle = " hidden class='PSPUSHBUTTONDISABLED' disabled=true ";
                  &strMarkCompleteAnchorStyle = " hidden class='PSPUSHBUTTONDISABLED' disabled=true ";
               Else
                  &strMarkCompleteStyle = "class='PSPUSHBUTTON'";
                  &strMarkCompleteAnchorStyle = "class='PSPUSHBUTTON'";
               End-If;
               /*end gregg */
            End-If;
            &strBind1 = &strBind1 | GetHTMLText(HTML.PTAI_AGBTNSHTML, &list_id, &pgltButtons.btnMethod, EscapeHTML(&pgltButtons.btnLabel), &strMarkCompleteStyle, EscapeHTML(EscapeJavascriptString(MsgGetExplainText(&pgltButtons.btnMsgSetNbr, &pgltButtons.btnMsgNbr, "F"))), &strMarkCompleteAnchorStyle);
         Else
            &strBind1 = &strBind1 | GetHTMLText(HTML.PTAI_AGBTNSHTML, &list_id, &pgltButtons.btnMethod, EscapeHTML(&pgltButtons.btnLabel), "class='PSPUSHBUTTON'", EscapeHTML(EscapeJavascriptString(MsgGetExplainText(&pgltButtons.btnMsgSetNbr, &pgltButtons.btnMsgNbr, "F"))), "class='PSPUSHBUTTON'");
         End-If;
      End-For;

      /*display list specific buttons in subpage if defined on AG Instance page*/
      If All(&strBind1) Then
         rem &strBind1 = GetHTMLText(HTML.PTAI_LISTBTNSHTML, &strBind1, %Response.GetImageURL(Image.PTAI_SEPERATOR));
      End-If;

      If All(&item_id) Then
         &strBind2 = GetHTMLText(HTML.PTAI_PREVBTNHTML, MsgGetText(263, 156, "Message Not Found - Previous"), %Response.GetImageURL(Image.PTAI_BTNARROWLEFT));
         &strBind3 = GetHTMLText(HTML.PTAI_NEXTBTNHTML, MsgGetText(263, 157, "Message Not Found - Next"), %Response.GetImageURL(Image.PTAI_BTNARROWRIGHT));
      End-If;

      /* Add hidden input field in nav sub page */
      &strHiddenFld = "PTAI=T&PTAI_LIST_ID=" | &ObjCurAItem.ListId | "&PTAI_ITEM_ID=" | &ObjCurAItem.ItemId;

      /*Append post processing app class and node name in url for remote crefs*/
      &strPkg = &ObjCurAItem.PackageRoot;
      &strPath = &ObjCurAItem.QualifyPath;
      &strClass = &ObjCurAItem.AppClassID;
      If All(&strPkg) And
            All(&strPath) And
            All(&strClass) Then
         If &strPath <> ":" Then
            &strAppClass = &strPkg | ":" | &strPath | ":" | &strClass;
         Else
            &strAppClass = &strPkg | ":" | &strClass;
         End-If;
         &strHiddenFld = &strHiddenFld | "&PTAI_POSTPROC=" | &strAppClass | "&PTAI_SRCNODE=" | %Node;
      End-If;

      &strHtml = GetHTMLText(HTML.PTAI_SUBPAGEBTNHTML, &strBind1, &strBind2, &strBind3, EscapeHTML(&currentList.Label), EscapeHTML(&strHiddenFld));
      %Response.Write(&strHtml);
   catch Exception &e
      %Response.Write(EscapeHTML(&e.ToString()));
   end-try;

End-Function;


/***********************************************
Performs actions on clicking custom AG subpage buttons like Exit/Cancel etc using ajax
***********************************************/

Function IScript_SubpageActions
   Local string &list_id, &strBtnLabel, &pkg, &path, &class, &strUrl, &strBtnMethod;
   Local PTAI_ACTION_ITEMS:List &currentList;
   Local PTAI_COLLECTION:Collection &buttons;
   Local PTAI_ACTION_ITEMS:PgltButtons &pgltButtons;
   Local object &obj;
   Local number &i;

   &list_id = Unencode(%Request.GetParameter("PTAI_LIST_ID"));
   &strBtnMethod = Unencode(%Request.GetParameter("PTAI_BTN_METHOD"));
   &currentList = create PTAI_ACTION_ITEMS:List();
   try
      &currentList.open(&list_id);
      &pkg = &currentList.pgltPackageRoot;
      &path = &currentList.pgltQualifyPath;
      &class = &currentList.pgltAppClass;

      If All(&pkg) And
            All(&path) And
            All(&class) Then
         If &path <> ":" Then
            &obj = CreateObject(&pkg | ":" | &path | ":" | &class);
         Else
            &obj = CreateObject(&pkg | ":" | &class);
         End-If;
      End-If;

      &buttons = &currentList.GetPgltBtn();

      For &i = 1 To &buttons.Count
         &pgltButtons = &buttons.Item(&i) As PTAI_ACTION_ITEMS:PgltButtons;
         If &strBtnMethod = &pgltButtons.btnMethod Then
            &strUrl = ObjectDoMethod(&obj, &pgltButtons.btnMethod, &list_id);
         End-If;
      End-For;

      If &strBtnMethod = "MarkComplete" Then
         %Response.Write(&strBtnMethod | &currentList.getCurrentItem());
      Else
         %Response.Write(EncodeURL(&strUrl));
      End-If;
   catch Exception &e
      rem %Response.Write(EscapeHTML(&e.ToString()));
      %Response.Write("");
   end-try;

End-Function;

