Function WMS_ADMIN_SMS_NOTICE();
   /*1/4/16 */

   /* Check to see if PSUSEREMAIL for this OPRID has an 'Other' email address defined 
   If so, assume it's a text email and see a short notice of login - when, where (IP)

   Call this when needed from end of WMS_ADMIN_IP_RESTRICTION
*/

   If %PSAuthResult = True Then
      &IP = %Request.RemoteAddr;
      &AuthOprid = %SignonUserId;
      &sql_SMSCheck = CreateSQL("SELECT COUNT(*) FROM PSUSEREMAIL WHERE OPRID= :1 AND EMAILTYPE = 'OTH'", &AuthOprid);
      &Ret = &sql_SMSCheck.Fetch(&SMSAddress_Check);
      If &SMSAddress_Check = 1 Then
         /* User has an OTH email address defined */
         &sql_SMSGet = CreateSQL("SELECT EMAILID FROM PSUSEREMAIL WHERE OPRID= :1 AND EMAILTYPE = 'OTH'", &AuthOprid);
         &Ret = &sql_SMSGet.Fetch(&SMS_Address);
         /*-- Create an outbound email object --*/

         Local PT_MCF_MAIL:MCFOutboundEmail &eMail = create PT_MCF_MAIL:MCFOutboundEmail();
         rem &eMail.From = "claidlaw@williams.edu";
         &eMail.From = %DbName | "@williams.edu";
         &eMail.Recipients = &SMS_Address;
         rem &eMail.Recipients = "Criss.Laidlaw@gmail.com";
         &eMail.Subject = "Login Notice";
         &eMail.Text = "To " | %DbName | " from " | %Request.RemoteAddr | " as " | %SignonUserId;
         Local integer &resp = &eMail.Send();

         /* Redirect to PIN page */
         /*
GenerateComponentContentURL(PORTAL.portalname, NODE.nodename, MENUNAME.menuname, MARKET.marketname, COMPONENT.componentname, PAGE.pagename, action, [, keylist])
*/
         &PIN_Page_URL = GenerateComponentContentURL(%Portal, %Node, MenuName.WMS_M906_MENU, %Market, Component.WMS_PIN_PAGE, Page.WMS_PIN_PAGE, "U");
         /* 
Note: on web profile config look & feel tab - Signon Result Doc Page - 
set to signonresultdocredirect.html 

 - internal URL but with auth false?
 - set roleuser to limit access, redirect to internal URL with auth true, reset roleuser limits if PIN is correct
   - update roleuser / force version # to re-read from table?  
 - external URL but how to reenter if auth succeeds?
*/
         SetAuthenticationResult( False, Upper(%SignonUserId), &PIN_Page_URL, False);


      End-If;
   End-If;

End-Function;



Function WMS_ADMIN_IP_RESTRICTION();
   /* 8/8/09 Debug */

   /*-- Create an outbound email object --*/
   /*
   Local PT_MCF_MAIL:MCFOutboundEmail &eMail = create PT_MCF_MAIL:MCFOutboundEmail();
   &eMail.From = "cs9852@williams.edu";
   &eMail.Recipients = "claidlaw@williams.edu";
   &eMail.Subject = "signon pcode report: " | %Request.RemoteAddr;
   &eMail.Text = "IP Address is " | %Request.RemoteAddr | " for user " | %SignonUserId | ".";
   Local integer &resp = &eMail.Send();
*/
   /*-- The send method uses the default SMTP parameters as set in the app server configuration file. 
This send method makes a connection to the SMTP server, sends the mail and then disconnects.
The result are returned as a number corresponding to the possible values. 
The list of ValidSent, InvalidSent and Invalid addresses are returned in the email object itself
----*/
   /* End 8/8/09 debug */

   If %PSAuthResult = True Then
      &Succeed = "Y";
      &IP = %Request.RemoteAddr;


      If &IP = "" Or
            &IP = "127.0.0.1" Then /* Local login (3-tier or same server) Okay */
         &IP = "137.165.";
      End-If;
      &AuthOprid = %SignonUserId;
      If &AuthOprid <> "PUBLIC" And
            &AuthOprid <> "WMSWEBPRSPCT" Then /* Forgot My Password account - okay */
         /* Check this User's Primary Permission List */
         &PPListMask = "PPWCSS%";
         &sql_SSCheck = CreateSQL("SELECT COUNT(*) FROM PSOPRDEFN WHERE OPRID= :1 AND (OPRCLASS LIKE :2 OR OPRCLASS = 'WCHR_SS_PRIMARY' OR OPRCLASS = 'WCCS_SS_PRIMARY')", &AuthOprid, &PPListMask);
         &Ret = &sql_SSCheck.Fetch(&SelfService_Check);
         If &SelfService_Check = 0 Then
            /* User isn't a self-service user - check IP Address */
            If Substring(&IP, 1, 7) = "137.165" Then /* Internal network user - okay */
               &Succeed = "Y";
            Else /* external network - not allowed to log in */
               &Succeed = "X";
            End-If;
         Else
            &Succeed = "Y";
         End-If;
      Else /* Forgot My Password or WebProspect */
         &Succeed = "Y";
      End-If;

      Evaluate &Succeed
         /* Set Authentication Result based on Succeed flag value */
      When = "Y"
         rem Okay to log in - AuthResult should have been set by Password_Controls;
         Break;
      When = "X" /* External Access from non-self-service user profile */
         &WMS_Ext_Access_Denied_HTML = "<P>Access with this User ID isn't permitted from the Internet.</P><P>You must first establish a secure connection to the Williams Network.  Please contact OIT for assistance.</P>";
         SetAuthenticationResult( False, Upper(%SignonUserId), &WMS_Ext_Access_Denied_HTML, False);
         Break;
      When-Other
         SetAuthenticationResult( False, Upper(%SignonUserId), "", False);
         Break;
      End-Evaluate;

   End-If;

End-Function;

