Function GetClassDtls
   &rs_StdntWeekSchd.Sort(SSS_STDNT_WKSCH.SUBJECT, "A", SSS_STDNT_WKSCH.CATALOG_NBR, "A", SSS_STDNT_WKSCH.CLASS_SECTION, "A");

   &obj_ClassInfo = create SSR_STUDENT_RECORDS:SR_ClassData:ClassInfo();

   &keys_prev = "";
   &keys_curr = "";
   For &i = &rs_StdntWeekSchd.ActiveRowCount To 1 Step - 1
      &ClsInstitution = &rs_StdntWeekSchd(&i).SSS_STDNT_WKSCH.INSTITUTION.Value;
      &ClsTerm = &rs_StdntWeekSchd(&i).SSS_STDNT_WKSCH.STRM.Value;
      &ClsNbr = &rs_StdntWeekSchd(&i).SSS_STDNT_WKSCH.CLASS_NBR.Value;
      &ClsCareer = &rs_StdntWeekSchd(&i).SSS_STDNT_WKSCH.ACAD_CAREER.Value;
      &keys_curr = &ClsInstitution | &ClsTerm | &ClsNbr;

      &rs_StdntWeekSchd(&i).DERIVED_SSS_SCL.STRM_1.Value = &ClsTerm;

      If &keys_curr = &keys_prev And
            &keys_prev <> "" Then
         &rs_StdntWeekSchd.DeleteRow(&i);
      Else
         &rs_StdntWeekSchd(&i).Visible = True;
         &obj_ClassInfo.LoadClassInfo(&ClsInstitution, &ClsTerm, &ClsNbr);

         &rs_StdntWeekSchd(&i).DERIVED_SSS_SCL.SSR_CLASSNAME_LONG.Value = &obj_ClassInfo.Class_Code;
         &rs_StdntWeekSchd(&i).DERIVED_SSS_SCL.SSR_CLASSNAME_LONG.Label = &obj_ClassInfo.Class_Code;
         &rs_StdntWeekSchd(&i).DERIVED_SSS_SCL.SSR_CLASSNAME_LONG.Enabled = False;
         &rs_StdntWeekSchd(&i).DERIVED_SSS_SCL.SSR_MTG_SCHED_LONG.Value = &obj_ClassInfo.Class_MtgLoc_List;
         &keys_prev = &keys_curr;
      End-If;

      /*	LMS link	*/
      &URL_STRING = GenerateScriptRelativeURL(%Portal, %Node, Record.WEBLIB_ESA, Field.VERIFY_CODE, "FieldFormula", "IScript_ESALogin") | "?compid=";
      /* If using LMS authentication (LMS_SSO_RULE), use the system generated URL. */
