row.hContStrData:
 HANDLE



              <script type="text/javascript">
<!-- This will redirect a student to an active activity guide if they have it -->

var agUser = "%BIND(:1)";
var agUrl = "%BIND(:2)";
var dtStamp = "%BIND(:3)";

//set the cookie
function setAGCookie(cname,cvalue) {
	//console.log("setAGCookie");
    var expires = "expires=Session";
    document.cookie = cname+"="+cvalue+"; "+expires+"; path=/";
}

//check to see if we've got an existing cookie
function getAGCookie(cname) {
	//console.log("getAGCookie");
    var name = cname + "=";
    var ca = document.cookie.split(';');
    for(var i=0; i<ca.length; i++) {
        var c = ca[i];
        while (c.charAt(0)==' ') c = c.substring(1);
        if (c.indexOf(name) == 0) {
            return c.substring(name.length, c.length);
        }
    }
    return "";
}

//check to see if we need to redirect someone
function checkAGCookie() {
	//console.log("checkAGCookie");
	//get the value for the redirectedToAG cookie
    var user=getAGCookie("redirectedToAG");
	//if there is a value...
    if (user != "") {
		//if dtStamp and agUser match the current value they're still in the same session and we don't need to send them back
		if(agUser+"_"+dtStamp == user)
		{			
			return "";
		}
		//if they're not the same, we need to set a new cookie and redirect
		else
		{	
			setAGCookie("redirectedToAG", agUser+"_"+dtStamp);
			location.replace(agUrl);
		}
    }
	//if there isn't an activity guide cookie, we need to set one and redirect 
	else {
        user = agUser;
        if (user != "" && user != null) {
            setAGCookie("redirectedToAG", user+"_"+dtStamp);
			location.replace(agUrl);
       }
    }
}

checkAGCookie();
</script>

