method BrandingBase
   Local string &styleSheet, &systemStyleSheet;

   SQLExec("SELECT STYLESHEETNAME FROM PSOPTIONS", &styleSheet);
   &systemStyleSheet = &styleSheet;

   If Find("SWAN", &styleSheet) > 0 Then
      &isSwanStyleSheet = True;
      &isCSSStyleSheet = False;
   Else
      If Find("TANG", &styleSheet) > 0 Then
         &isCSSStyleSheet = True;
         &isSwanStyleSheet = True;
      End-If;
   End-If;

end-method;

/**
  * Generates the header for the homepage. This method is called by 
  * IScript_HPDefaultHdr() in WEBLIB_PORTAL.PORTAL_HOMEPAGE
  * IScript_HPDefaultHdr() is called in HTML object PORTAL_HP_USER_TEMPLATE  
  *
*/
method GetIScriptHPDefaultHdrHTML
   /+ Returns String +/;

   Local string &hdrHTML;
   Local string &tabName = %Request.GetParameter("tab");
   &portal_inst = PortalOpen();

   &navOptions_inst = create PT_NAV2:NavOptions(&portal_inst, True);

   REM Classic header;
   If &navOptions_inst.navType = "L" Then
      &hdrHTML = %This.GetUniHeaderHTML(&tabName);

      REM header with the drop-down navigation;
   Else
      &hdrHTML = %This.getIframeHeaderHTML(&tabName);
   End-If;

   &portal_inst.Close();

   Return &hdrHTML;

end-method;

/**
  * generate HP Tab HTML, copy of WEBLIB_PORTAL.HOMEPAGE
  * Function GetHPTabHTML
*/
method GetHPTabHTML
   /+ &Portal as ApiObject, +/
   /+ &ActiveTabName as String, +/
   /+ &PersHTML as String out, +/
   /+ &TabHTML as String out, +/
   /+ &isSwan as Boolean +/

   Local Response &Response = %Response;
   Local ApiObject &SysTabColl, &UserTabColl, &SysTab, &UserTab, &PersCref;
   Local string &FirstTDHTML, &TabLabel, &HelpID, &LayoutHREF, &ContentHREF, &refreshHomepage, &PersLinkHTML, &PersText, &LayoutText, &ContentText, &HelpText;
   Local number &ValidTabCount, &OpDashBrdCount;
   Local boolean &ExactMatch;
   Local string &ContentScript, &options, &LayoutScript, &dashboardTitle;
   Local Request &req = %Request;
   Local string &dashboardName = &req.GetParameter("pslnkid");

   /* Added for remote dashboard */
   Local string &remoteDashboardName;

   If &ActiveTabName = "REMOTEUNIFIEDDASHBOARD" Then
      Local string &remotedburl1 = %Request.GetParameter("remotedburl");
      If &remotedburl1 <> "" Then
         &remotedburl1 = Unencode(&remotedburl1);
         Local number &ps1 = 0;
         &ps1 = Find("?tab=", &remotedburl1);
         &remoteDashboardName = Substring(&remotedburl1, &ps1 + 5, Len(&remotedburl1));
         Local number &endpos1 = Find("&", &remoteDashboardName);
         If (&endpos1 > 0) Then
            &remoteDashboardName = Substring(&remoteDashboardName, 1, &endpos1 - 1);
         End-If;
      End-If;
   End-If;
   /* Added End************************************/

   Local boolean &isUserPersDashboardTitle; /* flag to indicate the user has personalized the dashboard title */

   &SysTabColl = &Portal.TabDefinitions;
   &UserTabColl = &Portal.Homepage.UserTabs;



   If All(&dashboardName) Then

      &SysTab = &SysTabColl.ItemByName(&ActiveTabName);
      If All(&SysTab) And
            &SysTab.Authorized And
            IsValidDate(&SysTab) Then

         rem if the user has personalized the dashboard, and they've modified;
         rem the tab label, use the user's personalized label for the dashboard;
         If &UserTabColl.Count <> 0 Then
            &UserTab = &UserTabColl.ItemByName(&SysTab.Name);
            If All(&UserTab) And
                  &SysTab.IsRenameable And
                  Not Exact(&UserTab.Label, &SysTab.Label) Then
               &dashboardTitle = &UserTab.Label;
               &isUserPersDashboardTitle = True;
            End-If;
         End-If;

         rem if the user hasn't personalized, get the label from the dashboard;
         rem cref link, or use the system tab's label;
         If None(&dashboardTitle) Then
            &dashboardTitle = %This.getDashboardTitle(&Portal, &ActiveTabName, &dashboardName);
         End-If;
         If (&isCSSStyleSheet = True) Then
            &TabHTML = GetHTMLText(HTML.PORTAL_HP_ACTIVE_TAB_CSS, &dashboardTitle, "", &Response.GetImageURL(Image.PT_HOME_TAB_LINE_CSS), &Response.GetImageURL(Image.PT_HOME_TAB_ACTIVE_LEFT_CSS));
         Else
            &TabHTML = GetHTMLText(HTML.PORTAL_HP_ACTIVE_TAB, &dashboardTitle, "", &Response.GetImageURL(Image.PT_HOME_TAB_LINE), &Response.GetImageURL(Image.PT_HOME_TAB_ACTIVE_LEFT));
         End-If;
         &TabHTML = &TabHTML | GetHTMLText(HTML.PORTAL_HPTABNAME_COOKIE, &ActiveTabName, &remoteDashboardName);

         rem get the tab help ID;
         &HelpID = %This.getTabHelpId(&SysTab);
      End-If;

   Else
      If None(&UserTabColl) Then
         &UserTabColl = &SysTabColl;
      End-If;

      REM The first tab (active or inactive) always has 1 less <td>;
      &FirstTDHTML = "";

      REM Can't use the system tab collection count because it includes expired tabs, future tabs;
      &ValidTabCount = 0;

      REM Build the tab HTML;
      &SysTab = &SysTabColl.First();
      While &SysTab <> Null
         If IsValidDate(&SysTab) Then

            REM If the user has personalized, use the user's tab label;
            REM If the tab doesn't allow renames, the user tab label will be same as the system tab label;
            &UserTab = &UserTabColl.ItemByName(&SysTab.Name);
            If &UserTab <> Null Then
               &TabLabel = EscapeHTML(&UserTab.Label);
            Else
               &TabLabel = EscapeHTML(&SysTab.Label);
            End-If;

            If &SysTab.IsOpDashboard Then
               &OpDashBrdCount = &OpDashBrdCount + 1;
            End-If;

            REM did we find the active tab;
            &ExactMatch = Exact(&ActiveTabName, &SysTab.Name);
            If &ExactMatch Then


               If Not &SysTab.IsOpDashboard Then
                  If (&isCSSStyleSheet = True) Then
                     &TabHTML = &TabHTML | GetHTMLText(HTML.PORTAL_HP_ACTIVE_TAB_CSS, &TabLabel, &FirstTDHTML, &Response.GetImageURL(Image.PT_HOME_TAB_LINE_CSS), &Response.GetImageURL(Image.PT_HOME_TAB_ACTIVE_LEFT_CSS));
                  Else
                     &TabHTML = &TabHTML | GetHTMLText(HTML.PORTAL_HP_ACTIVE_TAB, &TabLabel, &FirstTDHTML, &Response.GetImageURL(Image.PT_HOME_TAB_LINE), &Response.GetImageURL(Image.PT_HOME_TAB_ACTIVE_LEFT));
                  End-If;

               End-If;

               REM ICE 567782002;
               &TabHTML = &TabHTML | GetHTMLText(HTML.PORTAL_HPTABNAME_COOKIE, &ActiveTabName, &remoteDashboardName);

               rem get the tab help ID;
               &HelpID = %This.getTabHelpId(&SysTab);
            Else
               If Not &SysTab.IsOpDashboard Then
                  If (&isCSSStyleSheet = True) Then
                     &TabHTML = &TabHTML | GetHTMLText(HTML.PORTAL_HP_INACTIVE_TAB_CSS, GetHomepaGetabURL(&SysTab.Name), &TabLabel, &FirstTDHTML, &Response.GetImageURL(Image.PT_HOME_TAB_LINE_CSS), &Response.GetImageURL(Image.PT_HOME_TAB_INACTIVE_LEFT_CSS));
                  Else
                     &TabHTML = &TabHTML | GetHTMLText(HTML.PORTAL_HP_INACTIVE_TAB, GetHomepaGetabURL(&SysTab.Name), &TabLabel, &FirstTDHTML, &Response.GetImageURL(Image.PT_HOME_TAB_LINE), &Response.GetImageURL(Image.PT_HOME_TAB_INACTIVE_LEFT));
                  End-If;
               End-If;
            End-If;
            &ValidTabCount = &ValidTabCount + 1;
         End-If;
         &SysTab = &SysTabColl.Next();
         If (&isCSSStyleSheet = True) Then
            &FirstTDHTML = GetHTMLText(HTML.PORTAL_HP_TAB_EXTRA_TD_CSS, &Response.GetImageURL(Image.PT_HOME_TAB_INACTIVE_RIGHT_CSS));
         Else
            &FirstTDHTML = GetHTMLText(HTML.PORTAL_HP_TAB_EXTRA_TD, &Response.GetImageURL(Image.PT_HOME_TAB_INACTIVE_RIGHT));
         End-If;
      End-While;
   End-If;

   REM Make sure the user is authorized to see the personalize content, layout links;
   If %This.canPersonalizeHomepage Then

      Local string &dashboardParam;
      If All(&dashboardName) Then
         &dashboardParam = "&pslnkid=" | &dashboardName;

         If Not &isUserPersDashboardTitle Then
            &dashboardParam = &dashboardParam | "&psdbtitle=" | EncodeURLForQueryString(EscapeHTML(&dashboardTitle));
         End-If;
      End-If;

      &PersText = MsgGetText(95, 58, "Message not found.");
      &LayoutText = MsgGetText(95, 59, "Message not found.");
      &ContentText = MsgGetText(95, 60, "Message not found.");
      &refreshHomepage = GetRefreshHPJS(&ActiveTabName);

      If Not &navOptions_inst.isAccessibility Then

         rem modal version;
         <* example 1 where close script can be passed in

         &oncloseScript = "function() {if (window.top.oParentWin) window.top.oParentWin.location.reload();}";
         &options = "bClose@1"
       &ContentScript = "javascript:showModal('" | &ContentHREF | "', window,'" | &options | "',null," | &oncloseScript | ");";

         example 2 to pass the url for close icon..

       &imgUrlModalClose = %Response.GetImageURL(Image.PT_PORTAL_IC_CLOSE);
         &imgUrlModalCloseAlt = MsgGetText(124, 326, "");
         &imgUrlModalResize = %Response.GetImageURL(Image.PT_RESIZE_IMG);
         &imgUrlModalResizeAlt = MsgGetText(124, 327, "");
         &imgUrlModalMoveAlt = MsgGetText(124, 328, "");
         &oncloseScript = "function() {if (window.top.oParentWin) window.top.oParentWin.location.reload();}";
         &options = "bClose@1;closeUrl@ " | &imgUrlModalClose | ";closeAlt@" | &imgUrlModalCloseAlt | ";resizeUrl@ " | &imgUrlModalResize | ";resizeAlt@" | &imgUrlModalResizeAlt | ";moveAlt@" | &imgUrlModalMoveAlt | ";Close@1;";
         &ContentScript = "javascript:showModal('" | &ContentHREF | "', window,'" | &options | "',null," | &oncloseScript | ");";
       *>

         rem generate the href;

         If &ActiveTabName <> "REMOTEUNIFIEDDASHBOARD" Then
            &ContentHREF = GenerateComponentContentURL(%Portal, %Node, MenuName.PORTAL_PERS_HOMEPAGE, "GBL", Component.PORTAL_HOMEPAGE, "", "") | "?PAGE=PORTAL_HPCOMP&tab=" | &ActiveTabName | &dashboardParam;
            &LayoutHREF = GenerateComponentContentURL(%Portal, %Node, MenuName.PORTAL_PERS_HOMEPAGE, "GBL", Component.PORTAL_HOMEPAGE, "", "") | "?PAGE=PORTAL_HPLAYOUT&tab=" | &ActiveTabName | &dashboardParam;
         Else
            Local string &remotedburl = %Request.GetParameter("remotedburl");
            If &remotedburl <> "" Then
               &remotedburl = Unencode(&remotedburl);


               Local array of string &arrTmp = Split(&remotedburl, "/");
               Local string &opdashboardname;
               Local number &ps = 0;
               &ps = Find("?tab=", &remotedburl);
               Local string &tabname1 = Substring(&remotedburl, &ps + 5, Len(&remotedburl));
               Local number &endpos = Find("&", &tabname1);

               &opdashboardname = Substring(&tabname1, 5, &endpos);
               Local string &nodename = %Node;
               If &arrTmp.Len >= 7 Then
                  &nodename = &arrTmp [7];
               End-If;

               rem Local Array of String &nodename = &remotedburl.split("/");
               &ContentHREF = GenerateComponentContentURL(%Portal, &nodename, MenuName.PORTAL_PERS_HOMEPAGE, "GBL", Component.PORTAL_HOMEPAGE, "", "") | "?PAGE=PORTAL_HPCOMP&tab=" | &tabname1;
               &LayoutHREF = GenerateComponentContentURL(%Portal, &nodename, MenuName.PORTAL_PERS_HOMEPAGE, "GBL", Component.PORTAL_HOMEPAGE, "", "") | "?PAGE=PORTAL_HPLAYOUT&tab=" | &tabname1;
            Else
               &ContentHREF = GenerateComponentContentURL(%Portal, %Node, MenuName.PORTAL_PERS_HOMEPAGE, "GBL", Component.PORTAL_HOMEPAGE, "", "") | "?PAGE=PORTAL_HPCOMP&tab=" | &ActiveTabName | &dashboardParam;
               &LayoutHREF = GenerateComponentContentURL(%Portal, %Node, MenuName.PORTAL_PERS_HOMEPAGE, "GBL", Component.PORTAL_HOMEPAGE, "", "") | "?PAGE=PORTAL_HPLAYOUT&tab=" | &ActiveTabName | &dashboardParam;
            End-If;
         End-If;

         rem generate the onClick JavaScript;
         Local string &contentOnClickJS = &refreshHomepage | "; showModal('" | &ContentHREF | "&ICModalJS=1', window,null,null,null,false,true); return false;";
         Local string &layoutOnClickJS = &refreshHomepage | "; showModal('" | &LayoutHREF | "&ICModalJS=1', window,null,null,null,false,true); return false;";

         &PersLinkHTML = GetHTMLText(HTML.PT_PORTAL_PERS_LINKS_MODAL, &PersText, &ContentHREF, &ContentText, &LayoutHREF, &LayoutText, &contentOnClickJS, &layoutOnClickJS);

      Else

         rem classic for accessible users;
         &ContentHREF = GenerateComponentRelativeURL(%Portal, %Node, MenuName.PORTAL_PERS_HOMEPAGE, "GBL", Component.PORTAL_HOMEPAGE, "", "") | "?PAGE=PORTAL_HPCOMP&tab=" | &ActiveTabName | &dashboardParam;
         &LayoutHREF = GenerateComponentRelativeURL(%Portal, %Node, MenuName.PORTAL_PERS_HOMEPAGE, "GBL", Component.PORTAL_HOMEPAGE, "", "") | "?PAGE=PORTAL_HPLAYOUT&tab=" | &ActiveTabName | &dashboardParam;
         &PersLinkHTML = GetHTMLText(HTML.PORTAL_HP_PERSONALIZE_LINKS_TD, &PersText, &ContentHREF, &ContentText, &LayoutHREF, &LayoutText, &refreshHomepage);

      End-If;
   End-If;

   REM System tab content and layout;
   Local string &strModifySysTabHTML = "";
   Local string &strSpaceHTML = "";
   Local string &strSysContentURL, &strSysLayoutURL;

   If %This.GetModifySysTabHTML(&Portal, &ActiveTabName, &strSysContentURL, &strSysLayoutURL) Then
      Local string &strModifyText = MsgGetText(95, 144, "Modify");
      Local string &strSysLayoutText = MsgGetText(95, 59, "Layout");
      Local string &strSysContentText = MsgGetText(95, 60, "Content");
      &refreshHomepage = GetRefreshHPJS(&ActiveTabName);
      &strModifySysTabHTML = GetHTMLText(HTML.PORTAL_HP_SYSTAB_LINKS, &strModifyText, &strSysContentURL, &strSysContentText, &strSysLayoutURL, &strSysLayoutText, &refreshHomepage);
   End-If;

   If All(&strModifySysTabHTML) And
         All(&PersLinkHTML) Then
      &strSpaceHTML = "&nbsp;&nbsp;&nbsp;&nbsp;";
   End-If;

   rem generate the homepage tab help link;
   Local string &helpLinkHTML;
   If All(&HelpID) Then
      &HelpText = MsgGetText(95, 410, "Message not found.");

      If &isSwan Then
         rem 508 complicance dictates that the Help link, image alt text, be null, when in accessibility mode;
         Local string &helpAltText = &HelpText;
         If &navOptions_inst.isAccessibility Then
            &helpAltText = "";
         End-If;

         &helpLinkHTML = GetHTMLText(HTML.PT_PORTAL_HPTAB_HELP_LINK_SWAN, %Request.GetHelpURL(&HelpID), &Response.GetImageURL(Image.PT_HELP), &helpAltText, &HelpText);
      Else
         &helpLinkHTML = GetHTMLText(HTML.PT_PORTAL_HPTAB_HELP_LINK, %Request.GetHelpURL(&HelpID), &HelpText);
      End-If;
   End-If;

   Local string &dashboardHTML;
   Local string &persLinksStyleClass = "pthp2perslinks";
   If None(&dashboardTitle) Then
      Local string &uninavpath = EscapeHTML(&req.GetParameter("uninavpath"));
      If &uninavpath <> "" Then
         Local array of string &fldrPath = Split(&uninavpath, "}.");
         If &fldrPath.Len > 0 Then
            Local array of string &UniNavCrefArr = Split(&fldrPath [&fldrPath.Len], "{");

            &dashboardTitle = RTrim(&UniNavCrefArr [1], "}");
         End-If;
      End-If;
   End-If;
   If All(&dashboardTitle) Then
      &persLinksStyleClass = "ptdboardlinks";
   End-If;

   Local string &strLinkHTML = GetHTMLText(HTML.PORTAL_HP_LINKS, &PersLinkHTML, &strModifySysTabHTML, &helpLinkHTML, &dashboardTitle, &persLinksStyleClass);

   If &ValidTabCount <= 1 Or
         &ValidTabCount - &OpDashBrdCount <= 1 Then

      &PersHTML = GetHTMLText(HTML.PORTAL_HP_PERSONALIZE_LINKS, &strLinkHTML);

      REM ICE 567782002;
      &TabHTML = GetHTMLText(HTML.PORTAL_HPTABNAME_COOKIE, &ActiveTabName, &remoteDashboardName);
   Else
      /* bind variables                               1           2       3                            4                               5   6                      7                                          8                          */
      If (&isCSSStyleSheet = True) Then
         &TabHTML = GetHTMLText(HTML.PORTAL_HP_TABS_CSS, &TabHTML, &strLinkHTML, "", &Response.GetImageURL(Image.PT_HOME_TAB_INACTIVE_RIGHT_CSS), "", "", &Response.GetImageURL(Image.PT_HOME_TAB_LINE_CSS), &Response.GetImageURL(Image.TRANSPARENT));
      Else
         &TabHTML = GetHTMLText(HTML.PORTAL_HP_TABS, &TabHTML, &strLinkHTML, "", &Response.GetImageURL(Image.PT_HOME_TAB_INACTIVE_RIGHT), "", "", &Response.GetImageURL(Image.PT_HOME_TAB_LINE), &Response.GetImageURL(Image.TRANSPARENT));
      End-If;
      &PersHTML = "";
   End-If;

end-method;

method GetPersLinkHTML
   /+ &Portal as ApiObject, +/
   /+ &ActiveTabName as String, +/
   /+ &ContentHREF as String out, +/
   /+ &LayoutHREF as String out +/
   /+ Returns Boolean +/

   Local ApiObject &PersCref;

   REM Make sure the user is authorized to see the personalize content, layout links;
   &PersCref = &Portal.FindCRefByName("PT_PORTAL_HOMEPAGE_GBL");

   If All(&PersCref) And
         &PersCref.Authorized Then
      &LayoutHREF = GenerateComponentRelativeURL(%Portal, %Node, MenuName.PORTAL_PERS_HOMEPAGE, "GBL", Component.PORTAL_HOMEPAGE, "", "") | "?PORTALPARAM_PAGE=LAYOUT&tab=" | &ActiveTabName;
      &ContentHREF = GenerateComponentRelativeURL(%Portal, %Node, MenuName.PORTAL_PERS_HOMEPAGE, "GBL", Component.PORTAL_HOMEPAGE, "", "") | "?PORTALPARAM_PAGE=CONTENT&tab=" | &ActiveTabName;
      Return True;
   Else
      Return False;
   End-If;

end-method;

method GetModifySysTabHTML
   /+ &Portal as ApiObject, +/
   /+ &ActiveTabName as String, +/
   /+ &strSysContentURL as String out, +/
   /+ &strSysLayoutURL as String out +/
   /+ Returns Boolean +/

   Local ApiObject &CRef;
   Local boolean &bDisplayLinks = False;

   REM Is the Modify Content / Layout links enabled for this portal;
   If &Portal.IsHpModifyLinks Then

      REM Make sure the user is authorized to see the Modify System tab component;
      &CRef = &Portal.FindCRefByName("PT_PTSYSTABADM_GBL");
      If All(&CRef) And
            &CRef.Authorized Then

         REM Special admin roles get access to all system tabs;
         If IsUserInRole("Portal Administrator", "PeopleSoft Administrator") Then
            &bDisplayLinks = True;
         Else
            REM No special role, so check if an admin role is defined for this portal;
            If All(&Portal.AdmRole) Then

               REM Is the current user allowed to modify this system tab;
               If IsUserInRole(&Portal.AdmRole) Then
                  &bDisplayLinks = True;
               End-If;

               REM No role, so anybody with access to the component can modify this tab;
            Else
               &bDisplayLinks = True;
            End-If;
         End-If;
      End-If;
   End-If;

   If &bDisplayLinks Then
      &strSysContentURL = GenerateComponentRelativeURL(%Portal, %Node, MenuName.PORTAL_ADMIN, "GBL", Component.PTSYSTABADM, Page.PTSYSTABCONTENT, "U") | "&tab=" | &ActiveTabName;
      &strSysLayoutURL = GenerateComponentRelativeURL(%Portal, %Node, MenuName.PORTAL_ADMIN, "GBL", Component.PTSYSTABADM, Page.PTSYSTABLAYOUT, "U") | "&tab=" | &ActiveTabName;
   End-If;

   Return &bDisplayLinks;

end-method;

