/**
* Builds the header link bar HTML for the header used in the iframe
*
*
*/
method setIframeHdrLinkHTML
   /+ &currHdrLinkHTML as String, +/
   /+ &linkHTML as String, +/
   /+ &sepHTML as String +/
   /+ Returns String +/
   Local string &newHrdLinkHTML = &currHdrLinkHTML;

   If &linkHTML <> "" Then
      &newHrdLinkHTML = &newHrdLinkHTML | GetHTMLText(HTML.PT_IFRAME_HDR_LI, &linkHTML) | &sepHTML;
   End-If;

   Return &newHrdLinkHTML;

end-method;

/**
  * private method to retrieve all applicable homepage JavaScript when using the new 8.50 header/dropdown nav
  *
*/
method getHomepageJS
   /+ Returns String +/

   Local Response &res = %Response;
   Local string &cookieJS, &refreshJS, &hpDndJS, &saveWarnCrossDomainJS, &saveWarnJS;

   &cookieJS = &res.GetJavaScriptURL(HTML.PORTAL_COOKIE);
   &refreshJS = &res.GetJavaScriptURL(HTML.PORTAL_REFRESHPAGE);

   /**
     * although save warning is not enabled on the homepage, we must include these scripts,
     * because the homepage calls setupTimeout(), which is defined in PT_SAVEWARNINGSCRIPT.
     * setupTimeout() also relies on several other functions defined in PT_SAVEWARNINGSCRIPT.
   */
   &saveWarnCrossDomainJS = &res.GetJavaScriptURL(HTML.PT_ISCROSSDOMAINNS6);
   &saveWarnJS = &res.GetJavaScriptURL(HTML.PT_SAVEWARNINGSCRIPT);

   REM if the user can modify the homepage and not in accessibility mode, add pagelet drag and drop JavaScript;
   If %This.canPersonalizeHomepage And
         (&navOptions_inst.isAccessibility = False) Then
      Local string &js1 = &res.GetJavaScriptURL(HTML.PT_HP2_JS);
      &hpDndJS = GetHTMLText(HTML.PT_HP2_DND_JS_INCLUDE, &js1);
   End-If;

   &imgUrlModalClose = %Response.GetImageURL(Image.PT_PORTAL_IC_CLOSE);
   &imgUrlModalCloseAlt = MsgGetText(124, 326, "");
   &imgUrlModalResize = %Response.GetImageURL(Image.PT_RESIZE_IMG);
   &imgUrlModalResizeAlt = MsgGetText(124, 327, "");
   &imgUrlModalMoveAlt = MsgGetText(124, 328, "");
   &hpDndJS = &hpDndJS | GetHTMLText(HTML.PT_HP2_JS_EXT, &imgUrlModalClose, &imgUrlModalCloseAlt, &imgUrlModalResize, &imgUrlModalResizeAlt, &imgUrlModalMoveAlt);

   rem Return GetHTMLText(HTML.PT_HP2_JS_INCLUDE, &cookieJS, &refreshJS, &saveWarnCrossDomainJS, &saveWarnJS, &hpDndJS);
   /* begin gregg AG mod 3/24/2016 */
   Return GetHTMLText(HTML.PT_HP2_JS_INCLUDE, &cookieJS, &refreshJS, &saveWarnCrossDomainJS, &saveWarnJS, &hpDndJS | Char(10) | Char(13) | %This.getCSSOverride());
   /* end gregg AG mod 3/24/2016 */
end-method;

/**
  * private method to retrieve all applicable homepage JavaScript for the "Classic" version of the homepage
  *
*/
method getClassicHomepageJS
   /+ Returns String +/

   Local Response &res = %Response;
   Local string &cookieJS, &refreshJS, &commonJS, &hpDndJS, &saveWarnJS;

   &cookieJS = &res.GetJavaScriptURL(HTML.PORTAL_COOKIE);
   &refreshJS = &res.GetJavaScriptURL(HTML.PORTAL_REFRESHPAGE);
   &commonJS = &res.GetJavaScriptURL(HTML.PT_COMMON);

   /* 
    *  this is added so the binds match up in PORTAL_HP_JS_INCLUDE. PT_SAVEWARNINGSCRIPT is will 
    *  have been already previously added. This will not cause an extra JavaScript request 
    *  since the browser will just pull it from cache.
   */
   &saveWarnJS = &res.GetJavaScriptURL(HTML.PT_SAVEWARNINGSCRIPT);

   REM if the user can modify the homepage and not in accessibility mode, add pagelet drag and drop JavaScript;
   If %This.canPersonalizeHomepage And
         (&navOptions_inst.isAccessibility = False) Then
      Local string &js1, &js2;
      &js1 = &res.GetJavaScriptURL(HTML.PT_AJAX_NET);
      &js2 = &res.GetJavaScriptURL(HTML.PT_HP2_JS);
      &hpDndJS = GetHTMLText(HTML.PT_HP2, &js1, &js2);
   Else
      /* must always add PT_AJAX_NET because pagelets are always loaded via ajax in HP now, starting in PT851 */
      &hpDndJS = "<script type=""text/javascript"" src=""" | &res.GetJavaScriptURL(HTML.PT_AJAX_NET) | """>" | Char(13) | "</script>" | Char(13);

   End-If;

   &imgUrlModalClose = %Response.GetImageURL(Image.PT_PORTAL_IC_CLOSE);
   &imgUrlModalCloseAlt = MsgGetText(124, 326, "");
   &imgUrlModalResize = %Response.GetImageURL(Image.PT_RESIZE_IMG);
   &imgUrlModalResizeAlt = MsgGetText(124, 327, "");
   &imgUrlModalMoveAlt = MsgGetText(124, 328, "");
   &hpDndJS = &hpDndJS | GetHTMLText(HTML.PT_HP2_JS_EXT, &imgUrlModalClose, &imgUrlModalCloseAlt, &imgUrlModalResize, &imgUrlModalResizeAlt, &imgUrlModalMoveAlt);

   Return GetHTMLText(HTML.PORTAL_HP_JS_INCLUDE, &cookieJS, &refreshJS, &commonJS, &saveWarnJS, &hpDndJS);

end-method;

rem method getCSSOverride
   rem /+ Returns String +/
   rem Return ""; /* derived classes can override this method to add their own css override */
rem end-method;

/* begin gregg AG mod 3/24/2016 */
method getCSSOverride
   /+ Returns String +/
   /* sets global var &blnStudentHasBeenRedirected */
   Local string &override = "";
   Local string &agInstance = "";
   Local string &agTemplate = "";
   Local string &agUrl = "";
   Local string &cookieDirective = "";
   Local string &agUser = %UserId;
   Local string &dtStamp = Substitute(Substitute(String(%Datetime), ".", ""), "-", ""); /* unique identifying string */

   /* check to see if the user has an assigned activity guide */
   /* really only set up for activity guides, could be made more generic with a little work */
   SQLExec(SQL.WMS_IP_ACTIVITY_GUIDE, &agUser, &agInstance, &agTemplate); /* returns info for the first assigned guide if there are multiple */
   If All(&agInstance, &agTemplate) Then
      If &blnStudentHasBeenRedirected <> True Then;
         /*set the redirect flag to true so it only happens once */
         &blnStudentHasBeenRedirected = True;
         /*get the base URL to the activity guide */
         &agUrl = GenerateComponentPortalURL(%Portal, %Node, MenuName.SCC_TASK_MGMT, %Market, Component.SCC_TM_WORKCENTER, Page.SCC_TM_WORKCENTER, "U");
         /*insert the GBL after the component because that doesn't happen automatically*/
         &agUrl = Substitute(&agUrl, ".?", ".GBL?");
         /*fill out the rest of the activity guide parameters*/
         &agUrl = &agUrl | "&CONTEXTIDPARAMS=TEMPLATE_ID:" | &agTemplate | "&CONTEXTIDPARAMS=INSTANCE_ID:" | &agInstance | "&replaceCurrentTopWindow=Y";
         /* put all of our variables in the js to be injected */
         &cookieDirective = GetHTMLText(HTML.WMS_AG_REDIRECT, &agUser, &agUrl, &dtStamp);
         &override = &override | Char(10) | Char(13) | &cookieDirective;
      End-If;
   End-If;
   Return &override; /* derived classes can override this method to add their own css override */
end-method;

