method GenAppAbnStyleSheetList
   /+ Returns String +/

   /**
   Generates a string in the following format:
   <link rel="stylesheet" href="http://rtdc79496vmc.dsi-inet.peoplesoft.com/cs/ps/cache/PSABNTEST2_10.css" type="text/css">
   <link rel="stylesheet" href="http://rtdc79496vmc.dsi-inet.peoplesoft.com/cs/ps/cache/PSABNTEST_8.css" type="text/css">
   **/

   Local Response &resp = %Response;
   Local SQL &styleSheetIdSql;
   Local array &styleSheetIdList;
   Local string &styleSheetId, &abnAppStyleSheetUrl, &abnStyleSheetList;
   Local integer &ePos;

   &styleSheetIdSql = CreateSQL("SELECT PORTAL_ATTR_VAL FROM PSPRSMSYSATTRVL WHERE PORTAL_ATTR_NAM = 'PORTAL_ABN_STYLE_SHEET' AND PORTAL_REFTYPE = 'F'");

   &styleSheetIdList = CreateArray();
   While &styleSheetIdSql.Fetch(&styleSheetId)
      &ePos = &styleSheetIdList.Find(&styleSheetId);
      If (&ePos = 0) Then
         rem if the style sheet id has not been processed, generate the text for the current style sheet id;
         rem this is to prevent duplicate <link> tags in the html;
         &styleSheetIdList.Push(&styleSheetId);
         &abnAppStyleSheetUrl = &resp.GetStyleSheetURL(&styleSheetId);
         &abnStyleSheetList = &abnStyleSheetList | GetHTMLText(HTML.PT_ABN_STYLESHEET_LINK, &abnAppStyleSheetUrl);
      End-If;
   End-While;

   Return &abnStyleSheetList;

end-method;

/* 
 * since a dashboard is a cref link to a homepage, have to determine the title from the link label
 * This gets called if the user hasn't personalized their dashboard or hasn't renamed it 
 *
*/
method getDashboardTitle
   /+ &portal as ApiObject, +/
   /+ &tabName as String, +/
   /+ &linkName as String +/
   /+ Returns String +/

   Local string &dashboardTitle;
   Local ApiObject &cref = &portal.FindCrefByName(&tabName);
   If All(&cref) And
         &cref.Authorized And
         &cref.IsVisible Then

      Local ApiObject &links = &cref.Links;
      Local ApiObject &link = &links.First();

      While All(&link)
         If &link.LinksObjectName = &linkName Then
            Break;
         End-If;

         &link = &links.Next();
      End-While;

      If All(&link) Then

         Local ApiObject &linkPortal, &crefLink;

         If &link.LinksPortalName = %Portal Then
            &crefLink = &portal.FindCRefLinkByName(&link.LinksObjectName);
         Else
            &linkPortal = PortalOpenByName(&link.LinksPortalName);
            &crefLink = &linkPortal.FindCRefLinkByName(&link.LinksObjectName);
         End-If;

         If All(&crefLink) And
               &crefLink.Authorized And
               &crefLink.IsVisible Then

            REM Use the Cref label if the link doesn't override the label;
            If All(&crefLink.Label) Then
               &dashboardTitle = &crefLink.Label;
            Else
               &dashboardTitle = &cref.Label;
            End-If;
         End-If;

         If All(&linkPortal) Then
            &linkPortal.Close();
         End-If;
      End-If;
   End-If;

   Return &dashboardTitle;
end-method;

/**
  * gets the PeopleBooks help Id for the active tab
  * find Help ID set for the tab, if not found, see if the HelpURL 
  * is set in the web profile and set the default
*/
method getTabHelpId
   /+ &sysTab as ApiObject +/
   /+ Returns String +/

   Local string &helpId;

   If None(&sysTab.HelpID) Then
      If %Request.GetHelpURL(&helpId) <> "" Then
         &helpId = "DEFAULTHOMEPAGE";
      End-If;
   Else
      &helpId = &sysTab.HelpID;
   End-If;

   Return &helpId;

end-method;

