      Local PTAI_ACTION_ITEMS:PgltButtons &btn = &taskButtons.Item(&i) As PTAI_ACTION_ITEMS:PgltButtons;
      If &btn.btnMethod = "MarkComplete" Then
         &btn.btnLabel = "_hiddenForComponent";
         &btn.btnMsgSetNbr = 0;
         &btn.btnMsgNbr = 0;
      End-If;
   End-For;
   &task.SavePgltBtn(&taskButtons);

   %This.StrRedirectUrl = GenerateComponentContentURL(%Portal, %Node, MenuName.WMS_SS_FD_MENU, &market, Component.WMS_SS_FD_VEH_INFO, Page.WMS_FD_VEH_INFO, "") | %This.StrAGQueryParameter;


end-method;

import PT_RCF:ServiceAGInterface;
import PTAI_ACTION_ITEMS:*;
import PTAI_COLLECTION:Collection;


class WMS_FD_WOOLF_Preprocessing extends PT_RCF:ServiceAGInterface
   method execute();
end-class;

method execute
   /+ Extends/implements PT_RCF:ServiceInterface.execute +/

   Local PTAI_ACTION_ITEMS:ActionItem &ObjAItem;
   Local boolean &boolSaved;
   Local string &market;
   Local PTAI_ACTION_ITEMS:List &task = create PTAI_ACTION_ITEMS:List();
   Local PTAI_COLLECTION:Collection &taskButtons = create PTAI_COLLECTION:Collection();
   Local number &i;

   &ObjAItem = create PTAI_ACTION_ITEMS:ActionItem();
   &ObjAItem.open(%This.StrActionItemId);
   If &ObjAItem.Status <> "4" Then
      &ObjAItem.Status = "2";
      &boolSaved = &ObjAItem.save();
   End-If;
   &market = %Market;
   If None(&market) Then
      &market = "GBL";
   End-If;
   /* Code to change the Label of Mark As Complete button based on the Action Item */
   &task.open(%This.StrListId);
   &taskButtons = &task.GetPgltBtn();
   For &i = 1 To &taskButtons.Count
      Local PTAI_ACTION_ITEMS:PgltButtons &btn = &taskButtons.Item(&i) As PTAI_ACTION_ITEMS:PgltButtons;
      If &btn.btnMethod = "MarkComplete" Then
         &btn.btnLabel = "_hiddenForComponent";
         &btn.btnMsgSetNbr = 0;
         &btn.btnMsgNbr = 0;
      End-If;
   End-For;
   &task.SavePgltBtn(&taskButtons);

   %This.StrRedirectUrl = GenerateComponentContentURL(%Portal, %Node, MenuName.WMS_SS_FD_MENU, &market, Component.WMS_SS_FD_WOOLF, Page.WMS_FD_WOOLF, "") | %This.StrAGQueryParameter;


end-method;
